if (!flow.get('waitingForData')) return [null,null,null,null];
if (msg.payload.length == 1)
{
    var msg1 = {'topic':'getChan1','payload':'CHAN1:DATA?\n'};
    var msg2 = {'topic':'getChan2','payload':'CHAN2:DATA?\n'};
    var msg3 = {'topic':'getChan3','payload':'CHAN3:DATA?\n'};
    context.set('itrace',1);
    return [msg1,msg2,msg3,null];
}
else
{
    if (context.get('itrace') == 1)
    {
        context.set('trace1',msg.payload);
        context.set('itrace',2);
        return [null, null,null,null];
    }
    if (context.get('itrace') == 2)
    {
        context.set('trace2',msg.payload);
        context.set('itrace',3);
        return [null, null,null,null];
    }
    if (context.get('itrace') == 3)
    {
        context.set('itrace',1);
        context.set('trace3',msg.payload);
        var scopeLimits = flow.get('scopeLimits');
        var nptsRev = Math.round(scopeLimits.npts * 176.0e-6 / flow.get('rfFreq') / (scopeLimits.xstop - scopeLimits.xstart));
        var istart0 = Math.round ((scopeLimits.npts - nptsRev) / 2);
        var trace1String = context.get('trace1').split(',');
        var trace2String = context.get('trace2').split(',');
        var trace3String = context.get('trace3').split(',');
        var rfFreq = flow.get('setupData').rfFreq;
        var magn = [];
        var phase = [];
        var bunchLength = [];
        var difPhase = [];
        var difBunchLength = [];
        var modeM = [];
        var modeB = [];
        var peakIntensity = [];
        var trace1 = [];
        var trace2 = [];
        var trace3 = [];
        var nptPerBunch = nptsRev / 176.0;
        var twoPi = 2.0 *3.1415927;

        for (var ii = 0; ii < 176; ++ii) 
        {
            var istart = Math.round(ii * nptPerBunch) + istart0;
            var istop  = istart + Math.round(nptPerBunch);
            trace1[ii] = 0.0;
            trace2[ii] = 0.0;
            trace3[ii] = 0.0;
            for (var ipt = istart; ipt <= istop; ++ipt) 
            {
                trace1[ii] = trace1[ii] + Number(trace1String[ipt]);
                trace2[ii] = trace2[ii] + Number(trace2String[ipt]);
                trace3[ii] = trace3[ii] + Number(trace3String[ipt]);
            }
            trace1[ii] = trace1[ii] / nptPerBunch;
            trace2[ii] = trace2[ii] / nptPerBunch;
            trace3[ii] = trace3[ii] / nptPerBunch;
            magn[ii] = Math.sqrt(trace1[ii] * trace1[ii] + trace2[ii] * trace2[ii]);
            phase[ii] = 0.0;
            if (magn[ii] > 0.0002)
            {
// added factor of two for 6 dB splitter
                phase[ii] = (1000000.0 / rfFreq) * Math.asin(2.0 * trace2[ii] / magn[ii]) / (2 * 3.1415927);
            }
// 186 mA when trace reades 0.098
            magn[ii] = (186.0 / 0.098) * magn[ii] / 176.0;
// diode fit with 1.86 fudge factor at 176.0ps bunch length
            peakIntensity[ii] = 1.86 * (1.02 * trace3[ii] + 0.23) / (176.0 * rfFreq * 1.0e-06);
            bunchLength[ii] = magn[ii] / (rfFreq * 1.0e-06) / peakIntensity[ii];
        }
        var lastTrace = context.get('lastTrace');

        if (lastTrace == null)
        {
            var phaseHistory = [[],[],[]];
            var bunchLengthHistory = [[],[],[]];
            phaseHistory[0] = phase;
            bunchLengthHistory[0] = bunchLength;
            for (var itrace = 1; itrace < 3; ++itrace)
            {
                for (var ii = 0; ii < 176; ++ii)
                {
                    phaseHistory[itrace][ii] = 0.0;
                    bunchLengthHistory[itrace][ii] = 0.0;
                }
            }
            context.set('phaseHistory',phaseHistory);
            context.set('bunchLengthHistory',bunchLengthHistory);
            context.set('lastTrace',0);
        }
        else
        {
            var phaseHistory = context.get('phaseHistory');
            var bunchLengthHistory = context.get('bunchLengthHistory');
            var nextTrace = lastTrace + 1;
            if (nextTrace > 2) nextTrace = 0;
            phaseHistory[nextTrace] = phase;
            bunchLengthHistory[nextTrace] = bunchLength;
            context.set('phaseHistory',phaseHistory);
            context.set('bunchLengthHistory',bunchLengthHistory);
            context.set ('lastTrace',nextTrace);
            for (var ii = 0; ii < 176; ++ii)
            {
                difPhase[ii] = phaseHistory[nextTrace][ii] - phaseHistory[lastTrace][ii];
                difBunchLength[ii] = bunchLengthHistory[nextTrace][ii] - bunchLengthHistory[lastTrace][ii];
            }
        }
        for (var mode = 0; mode < 88; ++mode)
        {
            var modeI = 0.0;
            var modeQ = 0.0;
            var modeIB = 0.0;
            var modeQB = 0.0;
            for (var bunch = 0; bunch < 176; ++bunch)
            {
                modeI = modeI + Math.cos(twoPi * mode  * bunch / 176.0 ) * difPhase[bunch];
                modeQ = modeQ + Math.sin(twoPi * mode  * bunch / 176.0 ) * difPhase[bunch];
                modeIB = modeIB + Math.cos(twoPi * mode  * bunch / 176.0 ) * difBunchLength[bunch];
                modeQB = modeQB + Math.sin(twoPi * mode  * bunch / 176.0 ) * difBunchLength[bunch];
            }
            modeI = modeI / 176.0;
            modeQ = modeQ / 176.0;
            modeM[mode] = Math.sqrt(modeI * modeI + modeQ * modeQ);
            modeIB = modeIB / 176.0;
            modeQB = modeQB / 176.0;
            modeB[mode] = Math.sqrt(modeIB * modeIB + modeQB * modeQB);
        }

        var msg4 =
        {
            'topic':'chanData',
            'payload':[magn, difPhase, modeM, trace1, trace2, trace3, bunchLength, difBunchLength, modeB, phase, peakIntensity]
        }
        flow.set('waitingForData', false);
        return [null, null,null,msg4];
    }
}

